import BabyInfo from "../babyInfo/BabyInfo";
import Nutrition from "../nutritionInfo/Nutrition";
import WeekData from "../weekData/WeekData";
import Advice from "../weeklyAdvice/Advice";
import Exercise from "../weeklyExercise/Exercise";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import ListGroup from "react-bootstrap/ListGroup";
import { useState, createContext, useEffect } from "react";
import ReactDOM from "react-dom/client";
import axios from "axios";
import WeeklyInfoProvider from "../../context/WeeklyInfoContext";
// import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import styled from "styled-components";
import Carousel from "react-bootstrap/Carousel";

import "./weeklyInfo.css";

function WeeklyInfo() {
  return (
    <WeeklyInfoProvider>
      <div className="weeklyInfoContainer">
        <div className="weekData"> week data</div>
        <div className="weekData"></div>
      </div>

      <Carousel>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src="holder.js/800x400?text=First slide&bg=373940"
            alt="First slide"
          />
          <Carousel.Caption>
            <h3>First slide label</h3>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>

      <Container>
        <Row>
          <Col>
            <WeekData />
          </Col>
        </Row>
        <Row>
          <Col>
            <BabyInfo />
          </Col>
          <Col>
            <BabyInfo />
          </Col>
        </Row>
        <Row>
          <Col>
            <BabyInfo />
          </Col>
          <Col>
            <Exercise />
          </Col>
        </Row>
      </Container>
    </WeeklyInfoProvider>
  );
}

const Container = styled.div`
  color: red;
`;

export default WeeklyInfo;
